import React  from "react";

const temas = [
    {
        "id":"Informatica",
        "sub": {
            "id":"Introduccion"
        }
    },
    {
        "id":"Concepto",
        "sub":"HOLA"
    }
]

const titulos_temas = temas.map((type) =>{
    return type.id
});
console.log(titulos_temas)
export function Nav(){
    return(
        <React.StrictMode>
            <ul>
                {
                    temas.map(type =>{
                        <li>type.id</li>
                    })
                }
            </ul>
        </React.StrictMode>
    )
}
